const comments = [
    {
        author: "Марина",
        text: "Дуже крутий фільм!!!",
        countLikes: 0,
        date: new Date().toLocaleDateString('ru-RU')
    },
    {
        author: "Олег",
        text: "Я в захваті. Буду обов'язково дивитись ще!)",
        countLikes: 100,
        date: new Date().toLocaleDateString('ru-RU')
    }
];

export default comments;
